package com.String;

public class TestStartWithStartEnd {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		
		//Java String startsWith() and endsWith() method
		
		String i = "Alebachew";
		
		System.out.println(i.startsWith("A"));  //true
		System.out.println(i.endsWith("w"));   //true
	}

}
